#include "metaInterfaceObject.h"

/* PNG */
static const wxString s_interface_16_png = wxT("");

wxIcon CMetaObjectInterface::GetIcon() const
{
	return GetIconGroup();
}

wxIcon CMetaObjectInterface::GetIconGroup()
{
	static wxIcon icon =
		CBackendPicture::GetIconFromBase64(s_interface_16_png, wxSize(16, 16));

	return icon;
}
